import backgroundOfCircle from "../assets/img/landingPage/backgroundOfCircle.png";
import "./CircularItems.css";
import "./Moonmap/moonMap.css";
import { useRef, useEffect } from "react";

function CircularItems() {
  const ref = useRef(null);
  useEffect(() => {
    var map = new window.MoonMap("#center", {
      moonSelector: ".moonSelector",
      radius: 185,
    });
  }, []);

  return (
    <div
      className=" col-sm-12 cirleOfElements bg-white"
      style={{
        backgroundImage: `url(${backgroundOfCircle})`,
      }}
    >
      <div id="center" class="orbit-center" ref={ref}>
        <span></span>
      </div>
      <span className="moonSelector bg-white"> <img src="https://media-exp1.licdn.com/dms/image/C560BAQHMnA03XDdf3w/company-logo_200_200/0/1519855918965?e=2147483647&v=beta&t=J3kUMZwIphc90TFKH5oOO9Sa9K59fimgJf-s_okU3zs" alt =''/></span>
      <span className="moonSelector">2</span>
      <span className="moonSelector">3</span>
      <span className="moonSelector">4</span>
      <span className="moonSelector">5</span>
      <span className="moonSelector">6</span>
      <span className="moonSelector">7</span>
      <span className="moonSelector">8</span>
      <span className="moonSelector">9</span>
      <span className="moonSelector">10</span>
      <span className="moonSelector">11</span>
      <span className="moonSelector">12</span>
      <span className="moonSelector">13</span>
    </div>
  );
}
export default CircularItems;
